import React from 'react';

export default ()=>{
  return(
    <div>

      <style jsx>{`
      div{
      background-color: #1c3643;
      width: 100%;
      margin: 0;
      padding: .5rem 1rem;
      display: flex;
      align-items: center;
      justify-content: end
    } 
      `}</style>
      <style jsx global>{`
        *{  
          margin: 0;
          padding: 0; 
        }
        body{
          font-family: 'Lato', sans-serif, Arial;
        }
      `}</style>
    </div>    
  )
}
